import { useState } from 'react';

const mockData = {
  locations: [
    { name: '美国', count: 15872, percentage: 32.9 },
    { name: '中国', count: 7238, percentage: 15.0 },
    { name: '印度', count: 5743, percentage: 11.9 },
    { name: '德国', count: 3526, percentage: 7.3 },
    { name: '英国', count: 2841, percentage: 5.9 },
    { name: '加拿大', count: 2319, percentage: 4.8 },
    { name: '法国', count: 1953, percentage: 4.0 },
    { name: '巴西', count: 1632, percentage: 3.4 },
    { name: '日本', count: 1475, percentage: 3.1 },
    { name: '澳大利亚', count: 1247, percentage: 2.6 },
    { name: '其他', count: 4427, percentage: 9.1 }
  ],
  totalContributors: 48273
};

const ContributorLocations = () => {
  const [data] = useState(mockData);

  // 生成渐变色
  const getLocationColor = (index, total) => {
    const hue = 200; // 蓝色调
    const saturation = 70;
    const minLightness = 40;
    const maxLightness = 75;

    // 根据索引计算亮度值，使颜色由深到浅
    const lightness = maxLightness - ((index / (total - 1)) * (maxLightness - minLightness));

    return `hsl(${hue}, ${saturation}%, ${lightness}%)`;
  };

  return (
    <div className="contributor-locations-page">
      <h1 className="page-title">贡献者地区分布</h1>

      <div className="stats-overview">
        <div className="card stat-card">
          <div className="stat-value">{data.totalContributors.toLocaleString()}</div>
          <div className="stat-label">贡献者总数</div>
        </div>
        <div className="card stat-card">
          <div className="stat-value">{data.locations.length - 1}</div>
          <div className="stat-label">主要国家/地区</div>
        </div>
        <div className="card stat-card">
          <div className="stat-value">{data.locations[0].name}</div>
          <div className="stat-label">贡献最多地区</div>
        </div>
      </div>

      <div className="card">
        <div className="card-header">
          <h2 className="card-title">地区分布图</h2>
        </div>
        <div className="card-body">
          <div className="map-placeholder">
            {/* 实际项目中这里可以使用地图库如react-simple-maps等 */}
            <div className="mock-map">
              <div className="map-message">
                在实际项目中，这里会展示一个交互式世界地图，
                显示不同国家/地区的贡献者密度
              </div>
            </div>
          </div>
        </div>
      </div>

      <div className="card">
        <div className="card-header">
          <h2 className="card-title">贡献者地区排名</h2>
        </div>
        <div className="card-body">
          <div className="locations-chart">
            {data.locations.map((location, index) => (
              <div key={location.name} className="location-bar">
                <div className="location-name">{location.name}</div>
                <div className="bar-container">
                  <div 
                    className="bar-fill" 
                    style={{ 
                      width: `${location.percentage}%`,
                      backgroundColor: getLocationColor(index, data.locations.length)
                    }}
                  ></div>
                  <span className="bar-value">
                    {location.count.toLocaleString()} ({location.percentage}%)
                  </span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContributorLocations;
